import React, { useEffect } from 'react'
import {useParams } from 'react-router-dom'
import { useDispatch, useSelector } from 'react-redux'


import { modelImage } from '../actions/productActions'


function AiModelScreen(text) {  

  const params = useParams();
  const dispatch = useDispatch();

  const imageData = useSelector(state => state.image);
  const { image } = imageData;


  useEffect(() => {
    dispatch(modelImage(`${params.text}`))

  }, [dispatch, params])


  return (
    <div>
      <h1> Stable Diffusion Model</h1>
      {console.log(image)}
    </div>
  )
}

export default AiModelScreen
